import React from 'react';
import Button from './components/Button';
import './App.css';

function App() {
  return (
    <div className="App">
      <div>
        <Button label='Add' color='green' />
        <Button label='Edit' color='blue' />
        <Button label='Delete' color='red' />
      </div>
    </div>
  );
}

export default App;
